import type { ImmerReducer, Subscription } from 'umi';

interface image3DModelType {
  namespace: string;
  state: image3DStateType;
  reducers: {
    InitState: ImmerReducer<image3DStateType>;
    setImageData: ImmerReducer<image3DStateType>;
  };
  subscriptions: {
    setup: Subscription;
  };
}
const image3DModelState = () => ({
  imageData: {
    plane_type_vr: {
      base64Data:
        '',
    },
    plane_type_coronal: {
      base64Data:
        '',
    },
    plane_type_sagittal: {
      base64Data:
        '',
    },
    plane_type_axial: {
      base64Data:
        '',
    },
  },
});

const image3DModel: image3DModelType = {
  namespace: 'image3DModel',
  state: image3DModelState(),
  reducers: {
    InitState(state: image3DStateType) {
      state = image3DModelState();
    },
    setImageData: function (state, action) {
      state.imageData = action.payload;
    },
  },
  subscriptions: {
    setup({ dispatch, history }) {
      history.listen(({ pathname }) => {
        if (pathname.indexOf('/listViewer') > -1) {
          dispatch({ type: 'InitState' });
        }
      });
    },
  },
};
export default image3DModel;
